import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

import Rating from '@mui/material/Rating';
import IconButton from '@mui/material/IconButton';
import { GoogleIcon } from './googleIcon';
import { HotPepperIcon } from './hotPepperIcon';
import { margin, maxWidth } from '@mui/system';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

export default function ResultCard(props) {
    return (
        <Card sx={{
            mb: 2,
            height: props.mode == 'noresults' ? 200 : 250
        }}>

            {props.mode != 'noresults' &&
                <CardMedia
                    component="img"
                    height="40"
                    image={props.photo}
                    alt="picture"
                />}

            <CardContent>
                <Grid container spacing={2}>
                    <Grid item xs={6} md={8}>

                        <Typography gutterBottom variant="h5" component="div"
                            sx={{ textAlign: 'center' }}>
                            {props.name}
                        </Typography>

                    </Grid>

                    <Typography variant="body2"
                        sx={{
                            fontSize: props.mode == 'noresults' ? '5rem' : '1rem',
                            textAlign: 'center'
                        }}
                        color="text.secondary">
                        {props.vicinity}
                    </Typography>
                    {props.mode != 'noresults' && <Rating name="read-only" value={props.rating} precision={0.5} />}
                    {props.mode != 'noresults' && <Typography>{`(${props.rat})`}</Typography>}
                </Grid>

            </CardContent>

            {props.mode != 'noresults' && <CardActions>
                <Button size="small">Share</Button>
                <Button size="small">Learn More</Button>
                {props.google && <IconButton onClick={() => window.open(`http://www.${props.google}`, "_blank")}>
                    <GoogleIcon />
                </IconButton>}
                {props.hotpepper && <IconButton onClick={() => window.open(`http://www.${props.hotpepper}`, "_blank")}>
                    <HotPepperIcon />
                </IconButton>}
            </CardActions>}
        </Card>
    );
}
